(1078, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:36:\"4 Women Making Moves in Web Creation\";s:7:\"excerpt\";s:173:\"Today is International Women’s Day, and what better way to celebrate girl power than with some inspiring stories from women web creators in our community across the globe.\";s:7:\"created\";i:1646738701;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:134:\"https://elementor.com/blog/women-making-moves-in-web-creation/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:75:\"The Opportunities and Challenges of Being a Female Web Entrepreneur in 2022\";s:7:\"excerpt\";s:305:\"While the web creates more equal opportunities, female founders secured only 2% of venture capital in the U.S. in 2021. Miriam Schwab, Co-founder and CEO of Strattic, shares her personal story and challenges as a female tech entrepreneur and why she firmly believes the future is bright for women in tech.\";s:7:\"created\";i:1646732431;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:149:\"https://elementor.com/blog/challenges-opportunities-for-female-entrepreneurs/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:35:\"The Hidden Costs of Website Hosting\";s:7:\"excerpt\";s:350:\"When you look at web hosting costs on a hosting provider\'s site, you\'ll typically see one single number for each plan. That\'s why it\'s easy to think that one price is all you\'ll ever pay. But Is that really the case? In this post, we\'re going to dig into web hosting costs in detail, including those hidden costs that you\'ll want to pay attention to.\";s:7:\"created\";i:1646652423;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:120:\"https://elementor.com/blog/hidden-hosting-costs/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:35:\"How To Create a Web Design Workflow\";s:7:\"excerpt\";s:204:\"Having a solid workflow can greatly improve your productivity and, in turn, your profit margins and client satisfaction. In this guide, we’ll break down the key phases and steps your workflow will need.\";s:7:\"created\";i:1646548620;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/web-design-workflow/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:44:\"Introducing Elementor’s New Wireframe Kits\";s:7:\"excerpt\";s:309:\"Translating a concept for a website or an idea into a full-blown designed website can be difficult. Add to that the need to align other stakeholders, and you may have a real challenge. With Wireframe Kits, you get a blueprint for a full website that you can build upon and add your own content and design to. \";s:7:\"created\";i:1645431039;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:130:\"https://elementor.com/blog/introducing-new-wireframe-kits/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
