(246, 1, '2022-03-09 00:01:16', '2022-03-09 00:01:16', '<!-- wp:paragraph -->\n<p>A WordPress theme consists of a collection of template files, stylesheets,<br>images, and JavaScript files. The theme controls the layout and design that<br>your visitors see on the site. When such a theme is properly set up as a<br>parent theme, it allows a child theme, or a subset of instructions, to override<br>its files. This ensures that a child theme can selectively modify the layout,<br>styling, and functionality of the parent theme.<br>The quickest way to understand child themes is by example. In this section,<br>you create a simple child theme that modifies the style of the parent theme.<br>Currently, the default WordPress theme is Twenty Fifteen. Figure 11-1 shows<br>how the Twenty Fifteen theme appears on a sample site.<br>You likely have Twenty Fifteen on your WordPress site; it’s a great candidate<br>for creating a child theme</p>\n<!-- /wp:paragraph -->', 'Newest Post', '', 'trash', 'open', 'open', '', 'newest-post__trashed', '', '', '2022-03-09 00:21:48', '2022-03-09 00:21:48', '', 0, 'http://localhost/newside/?p=246', 0, 'post', '', 0),
(247, 1, '2022-03-09 00:01:16', '2022-03-09 00:01:16', '<!-- wp:paragraph -->\n<p>A WordPress theme consists of a collection of template files, stylesheets,<br>images, and JavaScript files. The theme controls the layout and design that<br>your visitors see on the site. When such a theme is properly set up as a<br>parent theme, it allows a child theme, or a subset of instructions, to override<br>its files. This ensures that a child theme can selectively modify the layout,<br>styling, and functionality of the parent theme.<br>The quickest way to understand child themes is by example. In this section,<br>you create a simple child theme that modifies the style of the parent theme.<br>Currently, the default WordPress theme is Twenty Fifteen. Figure 11-1 shows<br>how the Twenty Fifteen theme appears on a sample site.<br>You likely have Twenty Fifteen on your WordPress site; it’s a great candidate<br>for creating a child theme</p>\n<!-- /wp:paragraph -->', 'Newest Post', '', 'inherit', 'closed', 'closed', '', '246-revision-v1', '', '', '2022-03-09 00:01:16', '2022-03-09 00:01:16', '', 246, 'http://localhost/newside/?p=247', 0, 'revision', '', 0),
