(315, 1, '2022-03-09 11:49:04', '2022-03-09 11:49:04', '{\n    \"sidebars_widgets[shoppingcart_footer_1]\": {\n        \"value\": [\n            \"block-52\"\n        ],\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-03-09 11:46:41\"\n    },\n    \"widget_block[49]\": {\n        \"value\": {\n            \"raw_instance\": {\n                \"content\": \"<!-- wp:paragraph -->\\n<p></p>\\n<!-- /wp:paragraph -->\"\n            }\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-03-09 11:44:41\"\n    },\n    \"widget_block[50]\": {\n        \"value\": {\n            \"raw_instance\": {\n                \"content\": \"<!-- wp:paragraph {\\\"align\\\":\\\"left\\\"} -->\\n<p class=\\\"has-text-align-left\\\">Customizing Theme Style with<br>Child Themes<br>A WordPress theme consists of a collection of template files, stylesheets,<br>images, and JavaScript files. The theme controls the layout and design that<br>your visitors see on the site. When such a theme is properly set up as a<br>parent theme, it allows a child theme, or a subset of instructions, to override<br>its files. This ensures that a child theme can selectively modify the layout,<br>styling, and functionality of the parent theme.<br>The quickest way to understand child themes is by example. In this section,<br>you create a simple child theme that modifies the style of the parent theme.<br>Currently, the default WordPress theme is Twenty Fifteen. Figure 11-1 shows<br>how the Twenty Fifteen theme appears on a sample site.<br>You likely have Twenty Fifteen on your WordPress site; it\\u2019s a great candidate<br>for creating a child theme</p>\\n<!-- /wp:paragraph -->\"\n            }\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-03-09 11:45:41\"\n    },\n    \"sidebars_widgets[shoppingcart_header_info]\": {\n        \"value\": [\n            \"block-